#Transform tf matrix (map to lower dimensions)
def transformTF(tf):

    concepts = pd.read_csv(conceptsFile)['Concept name'].tolist()

    boundaries = []
    labels = []
    start = 0
    concept = concepts[0]

    for end,c in enumerate(concepts):
        if c != concept:
            boundaries.append((start, end))
            labels.append(concept)
            start = end
            concept = c

    labels.append(concept)
    boundaries.append((start, end+1))

    tf = tf.T
    new_tf = np.empty((len(labels), tf.shape[1]))
    
    for i, b in enumerate(boundaries): 
        (start, end) = b
        new_tf[i] = tf[start:end].sum(axis=0)

    return new_tf.T, labels


#Read the corpus to the memory
def readCorpus():
    documents = spark.read.option('sep', '\t').csv(corpusFile, header=False, schema=StructType([StructField('article', StringType())]))
    documents = documents.limit(limitDocuments) if(limitDocuments!=-1) else documents
    documents = documents.rdd.repartition(cores)

    return documents


#Pretty print of numbers (by https://stackoverflow.com/a/45846841)
def human_format(num):
    num = float('{:.3g}'.format(num))
    magnitude = 0
    while abs(num) >= 1000:
        magnitude += 1
        num /= 1000.0
    return '{}{}'.format('{:f}'.format(num).rstrip('0').rstrip('.'), ['', 'K', 'M', 'B', 'T'][magnitude])